function CreateTx(props) {
  return (
    <div class="card my-4">
      <div class="card-header"> Create Tx </div>
      <div class="card-body">
        <form>
          <div class="row my-5">
            <label>Address</label>
            <input></input>
          </div>
          <div class="row">
            <label>Amount</label>
            <input></input>
          </div>
        </form>
      </div>
    </div>
  );
}

export default CreateTx;
